import React from 'react';
import './css/UI.css';

function Head(){
    return(
      <div className="Head Card">
      <div class="card-header">Header</div>
      <div class="card-body">Content</div>
      <div class="card-footer">Footer</div>
      </div>
  );
}
export default Head;
